import React, { Component } from 'react';

class Projects extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100vh"}}>
        <div
          style={{"width":"100%","height":"100%","backgroundColor":"#33466b","transform": "skewY(-1.5deg)"}}
          uk-scrollspy="cls: uk-animation-slide-left; repeat: true"
        >
          <div class="uk-column-1-2" uk-grid uk-scrollspy="cls: uk-animation-slide-left-small; target: > div > .uk-card; delay: 500; repeat: true">
            <div>
              <div class="uk-card uk-card-default uk-card-body" style={{"position":"absolute","width":"310px","height":"415px","backgroundColor":"#84a3ff", "marginLeft":"120px"}}></div>

                <div style={{"text-align":"center","position":"relative","background":"rgba(0,0,0,0)","box-shadow":"0 0px 0px rgba(0,0,0,0)"}} class="uk-card uk-card-default uk-card-body">
                    <img style={{"marginLeft":"10px","marginTop":"20px"}} src="pictures/me.jpg" width="50%" height="50%" alt="" uk-img/>
                </div>
            </div>
            <div>
                <div class="uk-card uk-card-default uk-card-body">
                    <h3 class="uk-card-title">Brian Yu</h3>
                    <p>Design</p>
                    <p>Architecture</p>
                    <p>Code</p>

                </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Projects;
